import React, { useState, useEffect, useCallback, useMemo } from "react";
import Layout from "../../components/Layout/Layout";
import UserMenu from "../../components/Layout/UserMenu";
import axios from "axios";
import { useAuth } from "../../context/auth";
import moment from "moment";
import { toast } from "react-hot-toast";

const Orders = () => {
  const [orders, setOrders] = useState([]);
  const [loading, setLoading] = useState(false);
  const [auth] = useAuth();

  // Memoize the auth token
  const authToken = useMemo(() => auth?.token, [auth]);

  const getOrders = useCallback(async () => {
    if (!authToken) return;

    try {
      setLoading(true);
      const { data } = await axios.get("/api/v1/payment/orders", {
        headers: {
          Authorization: authToken,
        },
      });
      if (data?.success) {
        setOrders(data.orders);
      }
      setLoading(false);
    } catch (error) {
      console.error("Error fetching orders:", error);
      toast.error("Error fetching your orders");
      setLoading(false);
    }
  }, [authToken]);

  useEffect(() => {
    if (authToken) {
      getOrders();
    }
  }, [authToken, getOrders]);

  // Format price for display
  const formatPrice = (price) => {
    return price.toLocaleString("en-IN", {
      style: "currency",
      currency: "INR",
    });
  };

  return (
    <Layout title={"Your Orders"}>
      <div className="container-fluid m-3 p-3">
        <div className="row">
          <div className="col-md-3">
            <UserMenu />
          </div>
          <div className="col-md-9">
            <h1 className="text-center mb-4">Your Orders</h1>

            {loading ? (
              <div className="text-center">
                <div className="spinner-border" role="status">
                  <span className="visually-hidden">Loading...</span>
                </div>
              </div>
            ) : orders?.length === 0 ? (
              <div className="text-center">
                <h3>No orders found</h3>
                <p>Start shopping to see your orders here!</p>
              </div>
            ) : (
              orders?.map((order) => (
                <div className="card shadow-sm mb-4" key={order._id}>
                  <div className="card-header bg-light">
                    <div className="row align-items-center">
                      <div className="col">
                        <h5 className="mb-0">Order ID: {order._id}</h5>
                      </div>
                      <div className="col text-end">
                        <span className={`badge bg-${order.status === "Delivered" ? "success" : 
                          order.status === "Cancelled" ? "danger" : "info"}`}>
                          {order.status}
                        </span>
                      </div>
                    </div>
                  </div>

                  <div className="card-body">
                    <div className="row mb-3">
                      <div className="col-md-6">
                        <p><strong>Order Date:</strong> {moment(order.createdAt).format("MMMM Do YYYY, h:mm a")}</p>
                        <p><strong>Payment ID:</strong> {order.payment?.razorpay_payment_id}</p>
                        <p><strong>Total Amount:</strong> {formatPrice(order.amount)}</p>
                      </div>
                      <div className="col-md-6">
                        <p><strong>Delivery Address:</strong></p>
                        <p className="text-muted">{auth?.user?.address}</p>
                      </div>
                    </div>

                    <h6 className="mb-3">Ordered Items</h6>
                    <div className="row">
                      {order.products?.map((item) => (
                        <div className="col-md-6 mb-3" key={item._id}>
                          <div className="card h-100">
                            <div className="row g-0">
                              <div className="col-md-4">
                                <img
                                  src={`/api/v1/product/product-photo/${item.product}`}
                                  alt={item.name}
                                  className="img-fluid rounded-start"
                                  style={{ height: "100%", objectFit: "cover" }}
                                />
                              </div>
                              <div className="col-md-8">
                                <div className="card-body">
                                  <h6 className="card-title">{item.name}</h6>
                                  <p className="card-text">
                                    <small className="text-muted">
                                      Price: {formatPrice(item.price)}
                                    </small>
                                  </p>
                                </div>
                              </div>
                            </div>
                          </div>
                        </div>
                      ))}
                    </div>
                  </div>
                </div>
              ))
            )}
          </div>
        </div>
      </div>
    </Layout>
  );
};

export default Orders;
